import "./Chat.css";
import {Avatar} from '@material-ui/core';
function Chat() {
    return (
        <div className="chat">

        <div className="header">
        <Avatar/>
        </div>
        <div className="chatting">
        </div>
        <div className="footer">
        </div>
        </div>
    )
}

export default Chat;
